import React from "react";

function Card(props){
    return(
        <div id="mycard">
        <div class="col-lg-4 col-md-6">
        <div class="card">
                <div class="card-body">
                <h5 class="card-title">{props.name}</h5>
                <p class="card-text">{props.desc}</p>
                <button class="btn btn-primary align-self-end">Solve Algorithm</button>
                </div>
            </div>
        </div>
            
        </div>
    )
}

export default Card;
